import register from '../register';
import {getParams} from '../utils';
import log from './index';
register('ubc/duration/disappear', {
    v: 4,
    hasCB: false,
    versionRange: ['8.3'],
    androidliteVersionRange: ['2.2.2'],
    androidmissionVersionRange: ['1.0'],
    iosmissionVersionRange: ['1.0'],
    androidinfoVersionRange: ['1.0'],
    notSupportFrame: {
        android: ['search']
    }
});
/**
 * ubc/duration/disappear
 * @function disappear
 * @param {object} [data={}] - ubc 参数
 */
export default (data = {}) =>
    log(
        getParams('durationDisappear', {
            data,
            abtest: data.abtest
        })
    );
